import Expenses from "./components/Expenses";


function App() {
  const expenses = [
    { id: 'e1', title: 'Car Insurance', amount: 294.67, date: new Date(2021, 2, 21) },
    { id: 'e2', title: 'Tooth Brush', amount: 294.67, date: new Date(2021, 2, 21) },
    { id: 'e3', title: 'Notes', amount: 294.67, date: new Date(2021, 2, 21) },
  ];
  return (
    <div>
      <Expenses title={expenses.title} amount={expenses.amount} date={expenses.date} />
    </div>
  );
}

export default App;
